import React from "react";
import style from "./Support.module.css";
import Ticket from "../Ticket/Ticket";

const Message = (props) => {
    return (
        <div className={style.message}>{props.messagetext}</div>)
}
const Support = (props) => {
    

    return (
        <div className={style.Support}>
            <div className={style.supportwrapper}>
                <div className={style.tickets}>
                    {ticketsData.map((ticket) => (<Ticket ticketsData = {ticketsData} key={ticket.id} ticketid={ticket.id} ticketheme={ticket.theme} />))}
                </div>
                <div className={style.chatcontainer}>
                    <div>
                        {messagesData.map((message) => (<Message messagesData = {messagesData} key={message.id} messagetext={message.messagetext} />))}
                    </div>
                </div>
            </div>
        </div>

    );
}

export default Support;
